class Solution(object):
    def maximumSum(self, nums):
        def prime_factors(n):
            factors = {}
            d = 2
            while d * d <= n:
                while (n % d) == 0:
                    if d in factors:
                        factors[d] += 1
                    else:
                        factors[d] = 1
                    n //= d
                d += 1
            if n > 1:
                if n in factors:
                    factors[n] += 1
                else:
                    factors[n] = 1
            return factors

        def gcd(a, b):
            while b:
                a, b = b, a % b
            return a

        def lcm(a, b):
            return a * b // gcd(a, b)

        from collections import defaultdict
        group = defaultdict(int)

        for num in nums:
            factors = prime_factors(num)
            mask = 0
            for p, cnt in factors.items():
                if cnt % 2 == 1:
                    mask ^= (1 << (p % 30))
            group[mask] += num

        return max(group.values())
